import React from 'react'
import {splash} from '../images'
const splashscreen = () =>{
    return(
        <div className='bg-purple'>
            <section className="container splashscreen">
                <img src={splash} className="rounded mx-auto d-block" alt="..." />
            </section>
        </div>
    )
}

export default splashscreen
